import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from 'react-router-dom';

import البطولات from './components/البطولات' ;
import Matches from "./components/Matches";
import Contact from "./components/Contact";
import Navbar from './components/Navbar';
import الملاعب from './components/الملاعب' ;
import الأحصائيات from './components/الأحصائيات' ;

function App() {
  return (

      <div>

<Router>
   <Navbar/>
   <main>
     <Switch>

       <Route path="/الملاعب" exact> <الملاعب/> </Route>

       <Route path="/البطولات" exact> <البطولات/> </Route>

       <Route path="/Matches" exact> <Matches/> </Route>

       <Route path="/الأحصائيات" exact> <الأحصائيات/> </Route>


       <Route path="/Contact" exact> <Contact/>  </Route>


       <Redirect to="/" />

     </Switch>
   </main>
  </Router>


      </div>


  );
}

export default App;
